window.bookSummaryJSON = "<p><b>Brink City. It’s the hellhole of America and has been ever since the magical world collided with our own. </b></p> <p>All the undesirables, those magical creatures and races who couldn’t fit into polite society, ended up there. Underground monster matches? Illegal enchantments? Monstrous ladies of the night? Potions that make you a god for a day? They can all be found in Brink City.</p> <p>And it’s my new playground.</p> <p>In time, every crime family will bend the knee to my rule. But I have to start from the bottom to reach the top, and I’m going to use every spell in the book to get there.</p>"; 
